import axios from 'axios';

export const apiUsers = (count, page) => {
    debugger;
    return axios.get(`https://social-network.samuraijs.com/api/1.0/users?count=${count}&page=${page}`, {
        withCredentials: true,
    }).then( (response) => {
        return response.data
    });
};



